import './App.css';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';

function App() {
  return (
    <div className="App">
        <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2}>
      <Grid item xs={8}>
        <Item>xs=8</Item>
      </Grid>
      <Grid item xs={4}>
        <Item>xs=4</Item>
      </Grid>
      <Grid item xs={4}>
        <Item>xs=4</Item>
      </Grid>
      <Grid item xs={8}>
        <Item>xs=8</Item>
      </Grid>
    </Grid>
    </Box>
    </div>
  );
}

export default App;
